import React from 'react'
import Slider from "react-slick";


function ConsultationCarousel() {

    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1
    };

    return (
        <div style={{backgroundColor:"red", width:"100%", height:"250px"}}>
            <Slider {...settings}>
                <div style={{backgroundColor:"green", width:"100%", height:"100%"}}>
                    <h3>1</h3>
                </div>
                <div>
                    <h3>2</h3>
                </div>

            </Slider>
        </div>
    )
}

export default ConsultationCarousel
